import React from 'react';

function educationSection() {
    return (
        <div>
            <div className="education">
                <h2>Education</h2>
                <p>XiDian University</p>
                <p>Major: Software Engineer</p>
                <p>2020-2024</p>
            </div>

            <div className='skills'>
                <h2>Skills</h2>
                <p>C++</p>
                <p>Python</p>
                <p>React</p>
                <p>HTML</p>
                <p>CSS</p>
                <p>JavaScript</p>
            </div>
        </div>
    );
    }

export default educationSection;
